import React from "react";

export default function Message(props) {
    return (
        <div className="Message" style={{
            display: "flex"
        }}>
            <h3>{props.sender}</h3>

            <p style={{
                backgroundColor: props.color,
            }}>
                {props.message}
            </p>
        </div>
    );
}
